  false,\n\t\"url\": null,\n\t\"notes\": \"The SEATAR files were compiled by the Scripps
  Institution of Oceanography with funds from IDOE/NSF, as part of the SIO world sediment
  data bank, under the direction of Jane Frazer and Mary Fisk. n          Data were
  abstracted from published sources through 1976 and include descriptions of 5919
  grabs/dredges and 2249 cores from the area 15 degrees south to 45 degrees north,
  90 degrees to 150 degrees east. n          The Indian Ocean, North Pacific Ocean,
  South China Sea, Philippine Sea, Inland Sea, Eastern China Sea, Yellow Sea, Japan
  Sea, East Indian Archipelago, Coral Sea, Solomon Sea, and Bismarck Seas are included.
  n          The files include station information, bibliographic references, and
  descriptive information including lithology, percent CaCO3, constituents by grain
  size, organic material/fossils, ages, other features, and minerals. n          Additional,
  geophysical data from the SEATAR project are also available through NCEI. Digital
  SEATAR sediment files are available for download.\",\n\t\"license_title\": null,\n\t\"extras\":
